			  quantity: 4,
			},
			repulse: {
			  distance: 200,
			  duration: 0.4,
			},
		  },
		},
		particles: {
		  color: {
			value: "#ff9ef9",
		  },
		  links: {
			color: "#f25e956b",
			distance: 150,
			enable: true,
			opacity: 0.2,
			width: 1,
		  },
		  collisions: {
			enable: true,
		  },
		  move: {
			direction: "none",
			enable: true,
			outMode: "bounce",
			random: false,
			speed: 1,
			straight: false,
		  },
		  number: {
			density: {
			  enable: true,
			  value_area: 800,
			},
			value: 30,
		  },
		  opacity: {
			value: 0.5,
		  },
		  shape: {
			type: "circle",
		  },
		  size: {
			random: true,
